An attribute set of overlays . Note that the overlays themselves are not mergeable. While overlays can be composed, the order of composition is significant, but the module system does not guarantee sufficiently deterministic definition ordering, across versions and when changing imports. Type : lazy attribute set of function that evaluates to a(n) function that evaluates to a(n) lazy attribute set of unspecified value Default {} Example {"_type":"literalExpression","text":"{
 default = final: prev: {};
}
